import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const AlunoCadastroPage = () => {
  const [formData, setFormData] = useState({
    nome: '',
    idade: '',
    email: '',
    telefone: '',
    experiencia: '',
    peso: '',
    altura: '',
    login: '', // Adicionado campo de login
    senha: '', // Adicionado campo de senha
    confirmarSenha: '', // Adicionado campo de confirmação de senha
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Verificar se as senhas coincidem
    if (formData.senha !== formData.confirmarSenha) {
      alert("As senhas não coincidem!");
      return;
    }

    // Aqui você pode fazer a lógica de envio dos dados, como uma chamada de API para salvar o aluno
    console.log('Dados do aluno:', formData);

    // Redirecionar para a página desejada após o cadastro, por exemplo, a página de lista de alunos
    navigate('/users'); // Altere conforme necessário
  };

  return (
    <div>
      <h2>Cadastro de Aluno</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Nome:</label>
          <input
            type="text"
            name="nome"
            value={formData.nome}
            onChange={handleChange}
            required
          />
        </div>
        
        <div>
          <label>Idade:</label>
          <input
            type="number"
            name="idade"
            value={formData.idade}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Peso (kg):</label>
          <input
            type="number"
            name="peso"
            value={formData.peso}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Altura (cm):</label>
          <input
            type="number"
            name="altura"
            value={formData.altura}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Email (ou Login):</label>
          <input
            type="email"
            name="login"
            value={formData.login}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Senha:</label>
          <input
            type="password"
            name="senha"
            value={formData.senha}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Confirmar Senha:</label>
          <input
            type="password"
            name="confirmarSenha"
            value={formData.confirmarSenha}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Nível de Experiência:</label>
          <select
            name="experiencia"
            value={formData.experiencia}
            onChange={handleChange}
            required
          >
            <option value="">Selecione</option>
            <option value="iniciante">Iniciante</option>
            <option value="intermediario">Intermediário</option>
            <option value="avancado">Avançado</option>
          </select>
        </div>

        <button type="submit">Cadastrar Aluno</button>
      </form>
    </div>
  );
};

export default AlunoCadastroPage;
